<h2>K-Means ì‹¤ìŠµ</h2><div class="example-box"><pre><code>from sklearn.cluster import KMeans
from sklearn.datasets import make_blobs

# ë°ì´í„° ìƒì„±
X, y_true = make_blobs(n_samples=300, centers=3, 
                      n_features=2, random_state=42)

# K-Means (k=3)
kmeans = KMeans(n_clusters=3, random_state=42, n_init=10)
labels = kmeans.fit_predict(X)

# ê²°ê³¼
print(f"êµ°ì§‘ ë ˆì´ë¸”: {labels[:10]}")
print(f"\nêµ°ì§‘ ì¤‘ì‹¬:")
print(kmeans.cluster_centers_)

print(f"\nInertia: {kmeans.inertia_:.2f}")

# ì‹œê°í™”
import matplotlib.pyplot as plt

plt.figure(figsize=(10, 6))
plt.scatter(X[:, 0], X[:, 1], c=labels, s=50, cmap='viridis')
plt.scatter(kmeans.cluster_centers_[:, 0], 
           kmeans.cluster_centers_[:, 1],
           c='red', s=300, marker='X', edgecolors='black')
plt.title('K-Means Clustering (k=3)')
plt.show()</code></pre></div>

<h2>ìµœì  K ì°¾ê¸°</h2><div class="example-box"><pre><code>from sklearn.metrics import silhouette_score

# ì—¬ëŸ¬ K ì‹œë„
inertias = []
silhouettes = []
k_range = range(2, 11)

for k in k_range:
    kmeans = KMeans(n_clusters=k, random_state=42)
    labels = kmeans.fit_predict(X)
    
    inertias.append(kmeans.inertia_)
    silhouettes.append(silhouette_score(X, labels))

# ê·¸ë˜í”„ë¡œ í™•ì¸
fig, axes = plt.subplots(1, 2, figsize=(14, 5))

axes[0].plot(k_range, inertias, 'bo-')
axes[0].set_xlabel('k')
axes[0].set_ylabel('Inertia')
axes[0].set_title('Elbow Method')
axes[0].grid(True)

axes[1].plot(k_range, silhouettes, 'go-')
axes[1].set_xlabel('k')
axes[1].set_ylabel('Silhouette Score')
axes[1].set_title('Silhouette Score')
axes[1].grid(True)

plt.show()</code></pre></div>

<h2>Hierarchical Clustering ì‹¤ìŠµ</h2><div class="example-box"><pre><code>from sklearn.cluster import AgglomerativeClustering
from scipy.cluster.hierarchy import dendrogram, linkage
import matplotlib.pyplot as plt

# ë°ì´í„°
X, y = make_blobs(n_samples=50, centers=3, 
                 n_features=2, random_state=42)

# 1. Dendrogram ê·¸ë¦¬ê¸°
Z = linkage(X, method='ward')

plt.figure(figsize=(12, 6))
dendrogram(Z)
plt.xlabel('Sample Index')
plt.ylabel('Distance')
plt.title('Hierarchical Clustering Dendrogram')
plt.show()

# 2. êµ°ì§‘í™” (k=3)
clustering = AgglomerativeClustering(n_clusters=3, linkage='ward')
labels = clustering.fit_predict(X)

# 3. ì‹œê°í™”
plt.figure(figsize=(10, 6))
plt.scatter(X[:, 0], X[:, 1], c=labels, s=100, cmap='viridis')
plt.title('Hierarchical Clustering Result')
plt.show()</code></pre></div>

        const slidesArray = slidesHTML.split('===SPLIT===');
        const container = document.getElementById('slidesContainer');
        const prevBtn = document.getElementById('prevBtn');
        const nextBtn = document.getElementById('nextBtn');
        const currentSlideSpan = document.getElementById('currentSlide');
        const totalSlidesSpan = document.getElementById('totalSlides');
        const pageInput = document.getElementById('pageInput');
        const jumpBtn = document.getElementById('jumpBtn');

        let currentSlide = 0;

        slidesArray.forEach((slideContent, index) => {
            const slideDiv = document.createElement('div');
            slideDiv.className = 'slide';
            slideDiv.innerHTML = slideContent.trim();
            container.appendChild(slideDiv);
        });

        const slides = document.querySelectorAll('.slide');
        totalSlidesSpan.textContent = slides.length;
        pageInput.max = slides.length;

        function showSlide(n) {
            slides.forEach(slide => slide.classList.remove('active'));
            
            if (n >= slides.length) {
                currentSlide = slides.length - 1;
            } else if (n < 0) {
                currentSlide = 0;
            } else {
                currentSlide = n;
            }

            slides[currentSlide].classList.add('active');
            currentSlideSpan.textContent = currentSlide + 1;

            prevBtn.disabled = currentSlide === 0;
            nextBtn.disabled = currentSlide === slides.length - 1;

            pageInput.value = '';
        }

        prevBtn.addEventListener('click', () => {
            showSlide(currentSlide - 1);
        });

        nextBtn.addEventListener('click', () => {
            showSlide(currentSlide + 1);
        });

        document.addEventListener('keydown', (e) => {
            if (e.target.tagName === 'INPUT') {
                return;
            }
            
            if (e.key === 'ArrowLeft') {
                showSlide(currentSlide - 1);
            } else if (e.key === 'ArrowRight' || e.key === ' ') {
                e.preventDefault();
                showSlide(currentSlide + 1);
            } else if ((e.ctrlKey || e.metaKey) && e.key === 'p') {
                e.preventDefault();
                window.print();
            }
        });

        jumpBtn.addEventListener('click', () => {
            const pageNum = parseInt(pageInput.value);
            if (pageNum && pageNum >= 1 && pageNum <= slides.length) {
                showSlide(pageNum - 1);
            } else {
                alert(`1ë¶€í„° ${slides.length} ì‚¬ì´ì˜ ë²ˆí˜¸ë¥¼ ì…ë ¥í•˜ì„¸ìš”.`);
            }
        });

        pageInput.addEventListener('keypress', (e) => {
            if (e.key === 'Enter') {
                jumpBtn.click();
            }
        });

        showSlide(0);
    </script>
